function App() {
  return (
    <BrowserRouter>
      <div>
        <Header />
        <Switch>
            <Route path="/">
              <Body page={current_page}/>
            </Route>
            <Route path="/work" component={Header} />
            <Route path="/tiletunes">
              <TileTunes />
            </Route>
            <Route path="/discobot">
              <DiscoBot />
            </Route>
            <Route path="/pvdcm">
              <PVDCM />
            </Route>
            <Route path="/wicshistory">
              <WiCSHistory />
            </Route>
          </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
